import React from 'react';
import '../assets/css/ToDos.css'

const List = (props) => {

  return (
    props.toDos.map(toDo => {
        <div className="todo-card">
          <input type="checkbox" />
          <span>{toDo.task}</span>
          <button>Delete</button>
        </div>
      })

  );
}

export default List;
